// src/App.jsx
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { SubscriptionProvider } from './context/SubscriptionContext';
import { SettingsProvider } from './context/SettingsContext';

// Components
import Header from './components/UI/Header';
import Dashboard from './components/Dashboard/Dashboard';
import PlanCards from './components/Accessibility/Subscription/PlanCards';
import SubscriptionConfirmation from './components/Accessibility/Subscription/SubscriptionConfirmation';
import ManageSubscription from './components/Accessibility/Subscription/ManageSubscription';
import EnhancedTripPlanner from './components/TravelPlanner/EnhancedTripPlanner';
import TripsList from './components/TravelPlanner/TripsList';
import CheapFlightsDashboard from './components/CheapFlights/CheapFlightsDashboard';
import FlightDealsView from './components/CheapFlights/FlightDealsView';
import DealAlerts from './components/CheapFlights/DealAlerts';
import UserSettings from './components/Settings/UserSettings';
import DestinationInfo from './components/DestinationInfo/DestinationInfo';
import EnhancedPackingList from './components/Packing/EnhancedPackingList';

// Utility components
import LoadingIndicator from './components/UI/LoadingIndicator';
import ResponsiveWrapper from './components/UI/ResponsiveWrapper';
import SkipToContent from './components/Accessibility/SkipToContent';

// Premium content guard
import PremiumContentGuard from './components/Subscription/PremiumContentGuard';

// CSS
import './App.css';

function App() {
  return (
    <Router>
      <SubscriptionProvider>
        <SettingsProvider>
          <div className="App">
            <SkipToContent />
            <Header />
            
            <main id="main-content">
              <ResponsiveWrapper>
                <React.Suspense fallback={<LoadingIndicator />}>
                  <Routes>
                    {/* Public Routes */}
                    <Route path="/" element={<Dashboard />} />
                    <Route path="/subscription/plans" element={<PlanCards />} />
                    <Route path="/subscription/confirm" element={<SubscriptionConfirmation />} />
                    <Route path="/subscription/manage" element={<ManageSubscription />} />
                    
                    {/* Free but limited features */}
                    <Route path="/flights/deals" element={<FlightDealsView />} />
                    
                    {/* Premium Routes (with subscription guard) */}
                    <Route 
                      path="/flights/dashboard" 
                      element={
                        <PremiumContentGuard>
                          <CheapFlightsDashboard />
                        </PremiumContentGuard>
                      } 
                    />
                    <Route 
                      path="/flights/alerts" 
                      element={
                        <PremiumContentGuard>
                          <DealAlerts />
                        </PremiumContentGuard>
                      } 
                    />
                    <Route 
                      path="/trip-planner" 
                      element={
                        <PremiumContentGuard>
                          <EnhancedTripPlanner />
                        </PremiumContentGuard>
                      } 
                    />
                    <Route 
                      path="/trips" 
                      element={
                        <PremiumContentGuard>
                          <TripsList />
                        </PremiumContentGuard>
                      } 
                    />
                    <Route 
                      path="/packing-list" 
                      element={
                        <PremiumContentGuard>
                          <EnhancedPackingList />
                        </PremiumContentGuard>
                      } 
                    />
                    <Route 
                      path="/destination/:id" 
                      element={
                        <PremiumContentGuard>
                          <DestinationInfo />
                        </PremiumContentGuard>
                      } 
                    />
                    
                    {/* Public User Preferences */}
                    <Route path="/settings" element={<UserSettings />} />
                    
                    {/* Fallback route */}
                    <Route path="*" element={<Dashboard />} />
                  </Routes>
                </React.Suspense>
              </ResponsiveWrapper>
            </main>
          </div>
        </SettingsProvider>
      </SubscriptionProvider>
    </Router>
  );
}

export default App;
